import './Navigation.css';

function Navigation(props) {
    return(
        <nav>
            <div className='nav-link-container'>
                <p className={`nav-link ${props.siteNumber === 1 ? 'active' : ''}`} onClick={() => props.setSiteNumber(1)}>Family </p>
                <p className={`nav-link ${props.siteNumber === 2 ? 'active' : ''}`} onClick={() => props.setSiteNumber(2)}>Site 2</p>
                <p className={`nav-link ${props.siteNumber === 3 ? 'active' : ''}`} onClick={() => props.setSiteNumber(3)}>Site 3</p>
                <div className='fansy-shit' style={{left: props.siteNumber === 1 ? '0.4%' : props.siteNumber === 2 ? '36%' : '66.5%'}}></div>
            </div>
        </nav>
    )
}

export default Navigation;
